import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

// Importation des modules Angular Material
import { MatIconModule } from '@angular/material/icon';
import { MatButtonModule } from '@angular/material/button';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';

// Importation des composants
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './components/header/header.component';
import { FooterComponent } from './components/footer/footer.component';
import { BannerComponent } from './components/admin/pages/accueil/banner/banner.component';

import { AccueilComponent } from './components/admin/pages/accueil/accueil.component';

import { DashboardComponent } from './components/admin/dashboard/dashboard.component';
// import { LoginComponent } from './components/admin/login/login.component';
// import { StatistiquesComponent } from './components/admin/statistiques/statistiques.component';
import { ContenuAccueilComponent } from './components/admin/pages/accueil/contenu-accueil/contenu-accueil.component';
// import { PromotionBannerComponent } from './components/admin/pages/accueil/promotion-banner/promotion-banner.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    BannerComponent,

    AccueilComponent,

    DashboardComponent,
    // LoginComponent,
    // StatistiquesComponent,
    ContenuAccueilComponent,
    // PromotionBannerComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule,  // Ajout du module d'animations
    MatIconModule,  // MatIconModule importé
    MatButtonModule // MatButtonModule importé
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
